import React, { useState, useEffect } from 'react'
import { Card, Divider } from 'antd';

const HMIWrapper = (props) => {

    //console.log(props.children)

    // let first = props.children.find(({ key }) => key === 'G2')
    const TabLabel = []

    props.Tab.forEach(element => {
        let TagBuffer = {
            key: element,
            tab: element,
        }
        TabLabel.push(TagBuffer)
    });

    console.log(TabLabel);



    const [tabkey, settabkey] = useState('Bleaching')

    const onTabChange = (key) => {
        console.log(key);
        settabkey(key)
    }

    const contentList = {

    }

    const tabList = [
        {
            key: 'Bleaching & Filtration',
            tab: 'Bleaching & Filtration',
        },
        {
            key: 'Deodorization 1',
            tab: 'Deodorization 1',
        },
    ]


    return (
        <div>
            <Divider orientation="left">Schemetic View</Divider>
            <div style={{ paddingTop: '20px' }}>
                <Card bordered={true}
                    style={{ borderRadius: 15, width: '100%' }} hoverable={false}
                    tabList={tabList}
                    bodyStyle={{ padding: "0" }}
                    headStyle={{ backgroundColor: '#c7bcbb', borderTopLeftRadius: 15, borderTopRightRadius: 15 }}
                    activeTabKey={tabkey}
                    onTabChange={key => {
                        onTabChange(key);
                    }}
                >
                    {contentList[tabkey]}
                </Card>
            </div>
        </div>
    )
}

export default HMIWrapper
